El código de aeropuertos de IATA está formado por grupos de tres letras, que designan a cada aeropuerto del mundo, asignadas por la Asociación Internacional de Transporte Aéreo (International Air Transport Association, IATA). Los códigos no son únicos: 323 de los aproximadamente 20 000 códigos existentes corresponden a más de un aeropuerto. Este código se emplea, por ejemplo, en las etiquetas que marcan el equipaje en las mesas de embarque de los aeropuertos. El código de tres letras se forma, como primera opción, tomando tres letras del nombre de la ciudad a la que sirve el aeropuerto. por ejemplo, «MAD» para el Aeropuerto Adolfo Suárez, que sirve a Madrid. Esas tres letras no tienen por qué ser las tres primeras letras del nombre de la ciudad, como en el caso de «BCN» para el Aeropuerto de El Prat, que sirve a Barcelona. Ni siquiera se incluye siempre la primera letra del nombre, como en el código «RGS» para el Aeropuerto de Burgos. Debido a que se pretende que cada aeropuerto tenga un identificador único, cuando asignar las iniciales no es posible de la forma antes indicada, se recurre a varias alternativas, como por ejemplo: 
*  utilizar el nombre de la ciudad en otra forma toponímica, casos de Jerez de la Frontera (Sherry o Xherry)-XRY y San Sebastián (Easo)-EAS; 
*  denominar la isla y no la ciudad como en el caso de Fuerteventura (Puerto del Rosario)-FUE; 
*  poner el nombre del aeropuerto, en aquellas ciudades que cuentan con más de uno, caso de Tenerife, que tiene Tenerife Sur-TFS y Tenerife Norte-TFN o Tenerife Canary Islands-TCI indistintamente. 
*  También se usa como alternativa, la utilización de solamente dos letras del nombre de la ciudad, que siguen sin tener que ser iniciales ni consecutivas, y añadir una letra arbitraria que haga el nombre único (Sevilla-SVQ, Santiago de Compostela-SCQ, La Coruña-LCG, Granada-GRX, Málaga-AGP, Melilla-MLN, Palma de Mallorca-PMI, y Santa Cruz de la Palma-SPC).
